import React from "react";
import Gallery from '../../page/Gallery';
import Home from "../../page/Home";
import Login from "../../page/Login";

export default [
    {
        path: '/',
        exact: true,
        component: () => <Home />,
        protected: null
    }, {
        path: '/gallery',
        component: () => <Gallery />,
        protected: 'auth'
    }, {
        path: '/login',
        component: () => <Login />,
        protected: 'guest'
    }
];
